import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Banner from './components/Banner';


function App() {
  return (
    <div className="App">

      <Header/>
      <Banner/>
      <main>
        <section>
          <h2 className="text-4xl font-semibold pb-5"></h2>
        </section>
      </main>
    </div>
  );
}

export default App;
